  Component 
} 
from 'react';

import {
  Jumbotron,
  VerticalLine,
  Display
}
from "./components/bootstrap";

class App extends Component {
  render() {
    return (
      <Jumbotron>
        <Display text="asdasd"/>
        <VerticalLine/>
      </Jumbotron>
    );
  }
}

export default App;
